import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';

class SelectBoard extends Component{
    render() {
        
        return (
            <div>
                <NavLink to='/posts'>
                    <Button >글 목록으로 돌아가기</Button>
                </NavLink>
                
            </div>
        );
    }
}

export default SelectBoard;
